where t.im_chat_message_City = #{city}
or t.fromuser_BID_City = #{city}
or t.sendtouser_BID_City=#{city}

SELECT  from dwd_effect_im_personim t
where t.im_chat_message_City = #{city}
and t.im_chat_message_type=#{imChatMessageType}
and t.logday >=  #{startTime}
and t.logday <=  #{endTime}
order by im_chat_message_messageid desc
limit #{pageSize} offset #{rows}

